(5382, 'BABE PEDIATRICO CREMA EMOLIENTE', 'Crema emoliente pediátrica apta para la piel de bebés y niños/as. Especialmente indicada para piel muy seca o con tendencia atópica. Nutre, repara y calma la sensación de picor, irritación y tirantez.', 'CREMAS', 1.00, NULL, NULL, NULL, NULL, NULL, NULL, '1706795409BABE PEDIATRIC EMOLIENT CREAM.jpg'),
