(5384, 'BABE PEDIATRICO GEL DE BAñO', 'Gel de baño pediátrico extra suave para la higiene diaria de los más pequeños. Ideal para dejar la piel limpia, suave, fresca y confortable tras el baño.', 'GEL', 125.00, NULL, NULL, NULL, NULL, NULL, NULL, '1706795717BABE PEDIATRIC BATH GEL.jpg'),
